settings\u0004Note: To disable a context:
注意：要禁用上下文菜单项，
将其复制到用户首选项并添加「disabled」键。
下面的示例将禁用文件浏览器上下文菜单中的下载选项：
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

上下文菜单描述：

settings\u0004Note: To disable a menu or:
注意：要禁用一个菜单或一个菜单项，
将其复制到用户选项并添加「disabled」键。
下面的示例将禁用「标签页」、「重启内核」以及「运行到所选单元格」项：
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

菜单描述：

settings\u0004Language-server specific c:
语言服务器的设置，按实现分类，例如：

pyls: {
  serverSettings: {
    pyls: {
      plugins: {
        pydocstyle: {
          enabled: true
        },
        pyflakes: {
          enabled: false
        },
        flake8: {
          enabled: true
        }
      }
    }
  }
}

可选的，使用 VSCode 的名称转换：

pyls: {
  serverSettings: {
    "pyls.plugins.pydocstyle.enabled": true,
    "pyls.plugins.pyflakes.enabled": false,
    "pyls.plugins.flake8.enabled": true
  }
}
